// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DocManager {

    struct Document {
        uint256 docId;
        string title;
        string content;
        string contentId;
        address issuer;
    }

    struct User {
        address userAddress;
        string username;
        bool isOrganization;
        uint256[] docs;
    }

    mapping(uint256 => Document) public documents;
    mapping(address => User) public users;

    modifier onlyIssuer(uint256 _docId) {
        require(documents[_docId].issuer == msg.sender, "Only the issuer can perform this action");
        _;
    }

    modifier onlyOrganization() {
        require(users[msg.sender].isOrganization, "Only organizations can perform this action");
        _;
    }

    function createUser(string memory _username, bool _isOrganization) external {
        require(users[msg.sender].userAddress == address(0), "User already exists");
        users[msg.sender] = User(msg.sender, _username, _isOrganization, new uint256[](10));
    }

    function createDocument(string memory _title, string memory _content, string memory _contentId) external {
        require(users[msg.sender].isOrganization, "Only organizations can issue documents");
        uint256 docId = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender)));
        Document storage newDocument = documents[docId];
        newDocument.docId = docId;
        newDocument.title = _title;
        newDocument.content = _content;
        newDocument.contentId = _contentId;
        newDocument.issuer = msg.sender;
    }

    function grantAccess(uint256 _docId, address _user) external onlyIssuer(_docId) {
        users[_user].docs.push(_docId);
    }

    function getMyDocs() external view returns (uint256[] memory) {
        return users[msg.sender].docs;
	}

    function verify(uint _docId) external view returns (Document memory ret){
        ret = documents[_docId];
    }

    function removeAccess(uint256 _docId, address _user) external onlyIssuer(_docId) {
        uint256 length = users[_user].docs.length;
        for (uint256 i = 0; i < length; i++) {
            if (users[_user].docs[i]==_docId) {
                users[_user].docs[i] = users[_user].docs[length - 1];
                users[_user].docs.pop();
                break;
            }
        }
    }


    function deleteDocument(uint256 _docId) external onlyOrganization onlyIssuer(_docId) {
        delete documents[_docId];
    }
}

